import React from 'react';
import { useState } from 'react';
import './CreatePost.css';


const CreatePost = () => {
    return(
        <div>
            <h1>Create a post!</h1>
            <div className='create-post-body'>
                <h3>Title:</h3>
                    <input type="text" name="blog-title" id='blog-title' row='30'/>
                <h3>Body:</h3>
                    <input type="text" name="blog-body" id="blog-body" col='30' row='50'/>
            </div>
        </div>
    )
}

export default CreatePost;
